import React from 'react'
import './projects.css';
import deco1 from '../res/deco-box1.png';
import deco2 from '../res/deco-box2.png';
import deco3 from '../res/deco-box3.png';
import Thumbnail from '../components/Thumbnail';
import Miso from '../res/misotn.png';
import Pokemon from '../res/pokemon.png';
import Fridge from '../res/fridgesmart.png';
import Penguin from '../res/penguin.png';
const Projects = () => {

  return (
    <main className='project-section'>
      <div className='project-head' name="project-section">
        <div className='white-line'>
        </div>
        <div className='main-line'>
          <p className='choose'>
            CHOOSE YOUR PROJECT...
          </p>
          <div className='buttons'>
            <img src={deco1} alt=''/>
            <img src={deco2} alt=''/>
            <img src={deco3} alt=''/>
          </div>
        </div>
        <div className='white-line'>
        </div>
      </div>

      <div className='project-thumbnails'>
        <Thumbnail name="Miso: UofTHacks Winner" image={Miso} href="https://github.com/stanleyylin/Miso" rel="noopener"/>
        <Thumbnail name="Pokemon" image={Pokemon} href="https://github.com/stanleyylin/Pokemon" rel="noopener"/>
        <Thumbnail name="FridgeSmart: DeltaHacks" image={Fridge} href="https://github.com/stanleyylin/FridgeSmart" rel="noopener"/>
        <Thumbnail name="Club Penguin: Java Edition" image={Penguin} href="https://github.com/stanleyylin/FridgeSmart" rel="noopener"/>


      </div>
    </main>
  )
}

export default Projects
